package bean;

public class viewCTHDClient {
	private long macthd;
	private String masp;
	private String tensp;
	private long gia;
	private String anh;
	private long slmua;
	private long mahd;
	public viewCTHDClient() {
		super();
		// TODO Auto-generated constructor stub
	}
	public viewCTHDClient(long macthd, String masp, String tensp, long gia, String anh, long slmua, long mahd) {
		super();
		this.macthd = macthd;
		this.masp = masp;
		this.tensp = tensp;
		this.gia = gia;
		this.anh = anh;
		this.slmua = slmua;
		this.mahd = mahd;
	}
	public long getMacthd() {
		return macthd;
	}
	public void setMacthd(long macthd) {
		this.macthd = macthd;
	}
	public String getMasp() {
		return masp;
	}
	public void setMasp(String masp) {
		this.masp = masp;
	}
	public String getTensp() {
		return tensp;
	}
	public void setTensp(String tensp) {
		this.tensp = tensp;
	}
	public long getGia() {
		return gia;
	}
	public void setGia(long gia) {
		this.gia = gia;
	}
	public String getAnh() {
		return anh;
	}
	public void setAnh(String anh) {
		this.anh = anh;
	}
	public long getSlmua() {
		return slmua;
	}
	public void setSlmua(long slmua) {
		this.slmua = slmua;
	}
	public long getMahd() {
		return mahd;
	}
	public void setMahd(long mahd) {
		this.mahd = mahd;
	}
	
}
